import * as React from 'react';
import {
  Button,
  View,
  Text,
  SafeAreaView,
  StyleSheet,
} from 'react-native';
import { Box, Flex, HStack, Stack, Center, NativeBaseProvider, Container, Heading } from "native-base"

const FirstPage = ({ navigation }) => {
  return (
    <SafeAreaView>
      <Center style={styles.container}>
        <Flex direction="row">
        <Box>
          <Flex direction="column" style={styles.firstColumn}>
            <Box
              style={styles.box}
              size={40}
              width="100%"
              bg="white">
              <Text style={styles.boxHeader}>
                Remember ðŸ”‘s
              </Text>
            </Box>
            <Box bg="white" size={40} width="100%">
              <Text style={styles.boxHeader}>
                Demos Today
              </Text>
            </Box>
            <Box size={40} width="100%" bg="white">
              <Text style={styles.boxHeader}>
                My Sales
              </Text>
            </Box>
          </Flex>
        </Box>
        <Box>
          <Flex direction="column" style={styles.secondColumn}>
            <Box size={80} width="100%" bg="white">
              <Text style={styles.boxHeader}>
                My Team
              </Text>
            </Box>
            <Box size={40} width="100%" bg="white">
              <Text style={styles.boxHeader}>
                My Badges
              </Text>
            </Box>
          </Flex>
        </Box>
        </Flex>
          <Box style={styles.next}>
            <Box size={500} bg="white">
              <Text style={styles.boxHeader}>
                Who's Next?
              </Text>
            </Box>
        </Box>
      </Center>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: "#F0F4FF",
    height: "100%",
  },
  next: {
    marginTop: "4em",
  },
  box: {
    borderRadius: 10,
    marginTop: "1em",
    marginLeft: "4em",
  },
  boxHeader: {
    color: "#ADB3D2",
    fontSize: "1.5em",
    paddingTop: "1em",
  },
  bigBlue: {
    color: 'blue',
    fontWeight: 'bold',
    fontSize: 30,
  },
  firstColumn: {
    width: "20em",
  },
  secondColumn: {
    marginLeft: "1em",
    marginRight: "6em",
    width: "20em",
  },
});

export default FirstPage;
